sys_variable_value.value:
(function parse(inputs, outputs) {

    try{
    var features = JSON.parse(inputs.sourceItem);
    outputs.targetObject = features;
    }
    catch (e) {

        gs.error("Error Encountered. Check logs for more details. " + e.toString());
        throw "An unexpected error occured while creating payload. " + e.toString();

    }



})(inputs, outputs);

